    data: |
      SELECT - - col0 AS col1 FROM tab0 (FORMAT parquet) AS cor0 WHERE - CAST ( NULL AS INTEGER ) + - 20 + - col1 NOT BETWEEN - 16 / 4 AND + - 29;
  - name: tab0

outputs:
  - name: q3421.out
    data: |
